import React from 'react';
import { Typography, Paper, Box, Button, FormControl, InputLabel, Select, MenuItem  } from '@mui/material';

function Settings() {
  const [currency, setCurrency] = React.useState('USD');

  const handleCurrencyChange = (event) => {
    setCurrency(event.target.value);
  };

  return (
    <Paper style={{ padding: '20px' }}>
      <Typography variant="h6" gutterBottom>
        Settings
      </Typography>

      {/* Currency selection */}
      <Box my={2}>
        <Typography variant="subtitle1">Select Currency</Typography>
        <FormControl fullWidth>
          <InputLabel id="currency-label">Currency</InputLabel>
          <Select
            labelId="currency-label"
            id="currency-select"
            value={currency}
            onChange={handleCurrencyChange}
            label="Currency"
          >
            <MenuItem value="USD">USD</MenuItem>
            <MenuItem value="AUD">AUD</MenuItem>
            <MenuItem value="EUR">EUR</MenuItem>
          </Select>
        </FormControl>
      </Box>

      {/* Subscription management */}
      <Box my={2} p={2} border={1} borderColor="grey.300" borderRadius={4}>
        <Typography variant="subtitle1">Subscription</Typography>
        <Box mt={1}>
          <Button variant="contained" color="secondary" style={{ marginRight: '10px' }}>
            Cancel Subscription
          </Button>
          <Button variant="contained" color="primary">
            Upgrade Subscription
          </Button>
        </Box>
      </Box>

      {/* Discord account linking */}
      <Box my={2}>
        <Typography variant="subtitle1">Discord Account</Typography>
        <Typography variant="body2" color="textSecondary">
          Link your Discord account to sync with your current account.
        </Typography>
        <Button variant="outlined" style={{ marginTop: '10px' }}>
          Link Discord
        </Button>
      </Box>
    </Paper>
  );
}

export default Settings;
